// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "./W2TCoinERC20.sol";

contract Wallet {
    event Deposit(address indexed sender, uint amount, uint balance);
    event SubmitTransaction(
        address indexed owner,
        uint indexed txIndex,
        address indexed to,
        uint value,
        bytes data
    );
    event ConfirmTransaction(address indexed owner, uint indexed txIndex);
    event RevokeConfirmation(address indexed owner, uint indexed txIndex);
    event ExecuteTransaction(address indexed owner, uint indexed txIndex);
    event AddOwner(address indexed owner);
    event RevokeOwner(address indexed owner);
    event SubmitRequestOwner(
        address indexed sender,
        uint indexed reqIndex,
        address indexed owner,
        bytes data,
        bool addOwner
    );
    event ConfirmRequestOwner(address indexed owner, uint indexed reqIndex);
    event ExecuteRequestOwner(address indexed owner, uint indexed reqIndex);

    string public name;
    uint public numConfirmationsRequired;
    address[] owners;
    address[] tokens;
    mapping(address => bool) isTokenControl;
    mapping(address => bool) isOwner;
    mapping(uint => mapping(address => bool)) public isConfirmed;
    mapping(uint => mapping(address => bool)) public reqConfirmed;

    struct Transaction {
        address destination;
        uint value;
        bytes data;
        uint numConfirmations;
        bool executed;
        address token;
    }

    struct RequestOwner {
        address owner;
        uint numConfirmations;
        bytes data;
        bool executed;
        bool addOwner;
    }

    Transaction[] public transactions;
    RequestOwner[] public requests;

    // modifier
    modifier onlyOwner() {
        require(isOwner[msg.sender], "Not owner");
        
        _;
    }

    modifier txExists(uint _txIndex) {
        require(_txIndex < transactions.length, "tx does not exist");
        _;
    }

    modifier notExecuted(uint _txIndex) {
        require(!transactions[_txIndex].executed, "tx already executed");
        _;
    }

    modifier notConfirmed(uint _txIndex) {
        require(!isConfirmed[_txIndex][msg.sender], "tx already confirmed");
        _;
    }

    modifier reqExists(uint _reqIndex) {
        require(_reqIndex < requests.length, "request owner not exists");
        _;
    }

    modifier reqNotConfirmed(uint _reqIndex) {
        require(!reqConfirmed[_reqIndex][msg.sender], "req already confirmed");
        _;
    }

    modifier reqNotExecuted(uint _reqIndex) {
        require(!requests[_reqIndex].executed, "req already executed");
        _;
    }

    // Contract constructor
    constructor(string memory _name, uint _numConfirmationsRequired, address[] memory _owners) payable {
        require(_owners.length > 0, "Owners required");
        require(_numConfirmationsRequired > 0 &&
        _numConfirmationsRequired <= _owners.length, "Invalid number of required confirmations");

        for(uint i = 0; i < _owners.length; i++) {
            address owner = _owners[i];
            require(owner != address(0), "invalid owner");
            require(!isOwner[owner], "owner not unique");
            isOwner[owner] = true;
            owners.push(owner);
        }

        name = _name;
        numConfirmationsRequired = _numConfirmationsRequired;

    }

    receive() external payable {
       emit Deposit(msg.sender, msg.value, address(this).balance);
    }

    function submitRequestOwner(
        address _owner,
        bytes memory _data,
        bool _addOwner
    ) public onlyOwner {
        require((!isOwner[_owner] && _addOwner) || (isOwner[_owner] && !_addOwner), "Owner not unique");
        uint reqIndex = requests.length;
        requests.push(
            RequestOwner({
                owner: _owner,
                data: _data,
                addOwner: _addOwner,
                executed: false,
                numConfirmations: 1
            }));
        reqConfirmed[reqIndex][msg.sender] = true;
        emit SubmitRequestOwner(msg.sender, reqIndex, _owner, _data, _addOwner);
    }

    function confirmRequestOwner(uint _reqIndex)
     public
     onlyOwner
     reqExists(_reqIndex)
     reqNotConfirmed(_reqIndex)
     reqNotExecuted(_reqIndex)
    {
        RequestOwner storage request = requests[_reqIndex];
        request.numConfirmations += 1;
        reqConfirmed[_reqIndex][msg.sender] = true;

        emit ConfirmRequestOwner(msg.sender, _reqIndex);
    }

    function executeRequestOwner(uint _reqIndex) 
     public
     onlyOwner
     reqExists(_reqIndex)
     reqNotExecuted(_reqIndex)
    {
        RequestOwner storage request = requests[_reqIndex];
        require(request.numConfirmations >= owners.length, "Cannot execute change Owner off wallet");
        if (request.addOwner) {
            owners.push(request.owner);
            isOwner[request.owner] = true;
            emit AddOwner(msg.sender);
        } else {
            isOwner[request.owner] = false;
            emit RevokeOwner(msg.sender);
        }
        emit ExecuteRequestOwner(msg.sender, _reqIndex);
    }

    function submitTransaction(
        address _destination,
        uint _value,
        bytes memory _data,
        address _token
    ) public onlyOwner {
        uint txIndex = transactions.length;
        transactions.push(
            Transaction({
            destination: _destination,
            value: _value,
            data: _data,
            executed: false,
            numConfirmations: 1,
            token: _token
        }));
        isConfirmed[txIndex][msg.sender] = true;
        emit SubmitTransaction(msg.sender, txIndex, _destination, _value, _data);
    }

    function confirmTransaction(uint _txIndex)
     public
     onlyOwner
     txExists(_txIndex)
     notExecuted(_txIndex)
     notConfirmed(_txIndex)
     {
        Transaction storage transaction = transactions[_txIndex];
        transaction.numConfirmations += 1;
        isConfirmed[_txIndex][msg.sender] = true;

        emit ConfirmTransaction(msg.sender, _txIndex);
     }

    function executeTransaction(uint _txIndex)
        public
        onlyOwner
        txExists(_txIndex)
        notExecuted(_txIndex)
    {
        Transaction storage transaction = transactions[_txIndex];

        require(
            transaction.numConfirmations >= numConfirmationsRequired,
            "cannot execute tx"
        );

        transaction.executed = true;
        if(transaction.token != address(0)) {
            W2TCoinERC20(transaction.token).transfer(transaction.destination, transaction.value);
        } else {
        (bool success, ) = transaction.destination.call{value: transaction.value}(
            transaction.data
        );
        require(success, "tx failed");
        }
        emit ExecuteTransaction(msg.sender, _txIndex);
    }

    function revokeConfirmation(uint _txIndex)
        public
        onlyOwner
        txExists(_txIndex)
        notExecuted(_txIndex)
    {
        Transaction storage transaction = transactions[_txIndex];

        require(isConfirmed[_txIndex][msg.sender], "tx not confirmed");

        transaction.numConfirmations -= 1;
        isConfirmed[_txIndex][msg.sender] = false;

        emit RevokeConfirmation(msg.sender, _txIndex);
    }

    function getBalance() external view returns (uint) {
        return address(this).balance;
    }

    function getOwners() public view returns (address[] memory) {
        return owners;
    }

    function getTransactions() public view returns (Transaction[] memory) {
        return transactions;
    }

    function getTokens() public view returns (address[] memory) {
        return tokens;
    }

    function getTransactionCount() public view returns (uint) {
        return transactions.length;
    }

    function getRequestOwnerCount() public view returns (uint) {
        return requests.length;
    }

    function getTransaction(uint _txId) public txExists(_txId) view returns (
            address destination,
            uint256 value,
            bytes memory data,
            bool executed,
            uint256 numConfirmations,
            address token) {
         Transaction storage transaction = transactions[_txId];

         return (
             transaction.destination,
             transaction.value,
             transaction.data,
             transaction.executed,
             transaction.numConfirmations,
             transaction.token
         );
    }

    function getRequestOwner(uint _reqId) public reqExists(_reqId) view returns (
        address owner,
        uint numConfirmations,
        bytes memory data,
        bool executed,
        bool addOwner
    ) {
        RequestOwner storage request = requests[_reqId];
        return (
            request.owner,
            request.numConfirmations,
            request.data,
            request.executed,
            request.addOwner
        );
    }
    // Token Controls

    function addTokenManage(address _address) public onlyOwner {
        require(!isTokenControl[_address], "Token not unique");
        isTokenControl[_address] = true;
        tokens.push(_address);
    }
    function createToken(string memory _name,
     string memory _symbol, uint8 _decimals, uint256 _total) public onlyOwner returns(W2TCoinERC20) {
         W2TCoinERC20 coin = new W2TCoinERC20(_name, _symbol, _decimals, _total);
         tokens.push(address(coin));
         return coin;
    }
    function getBalanceOfToken(address _addressToken, address _addrWallet) public view returns(uint256) {
        return W2TCoinERC20(_addressToken).balanceOf(_addrWallet);
    }
}
